CREATE PROCEDURE [Add_TestStatistics]
  @TestSetId UNIQUEIDENTIFIER,
  @Power FLOAT,
  @P FLOAT,
  @IsStatisticalRelevant BIT
WITH EXECUTE AS OWNER
AS

BEGIN

  /* 
     Fact_Traffic has no primary key, so we should use UPDATE TOP(1) to make sure only one row is updated. MERGE statement cannot be used and may lead to data corruption.
  */
  SET NOCOUNT ON;

  UPDATE TOP (1)
    [dbo].[Fact_Traffic]
  SET
    [Visits] = ([Visits] + @Visits),
    [Value] = ([Value] + @Value)
  WHERE
    ([Date] = @Date) AND
    ([Checksum] = @Checksum) AND
    ([TrafficType] = @TrafficType) AND
    ([CampaignId] = @CampaignId) AND
    ([ItemId] = @ItemId) AND
    ([KeywordsId] = @KeywordsId) AND
    ([ReferringSiteId] = @ReferringSiteId) AND
    ([SiteNameId] = @SiteNameId) AND
    ([DeviceNameId] = @DeviceNameId) AND
    ([LanguageId] = @LanguageId) AND
    ([FirstVisit] = @FirstVisit);

  IF( @@ROWCOUNT = 0 )
  BEGIN
    INSERT INTO [dbo].[Fact_Traffic]
    (
      [Date],
      [Checksum],
      [TrafficType],
      [CampaignId],
      [ItemId],
      [KeywordsId],
      [ReferringSiteId],
      [SiteNameId],
      [DeviceNameId],
      [LanguageId],
      [FirstVisit],
      [Visits],
      [Value]
    )
    VALUES
    (
      @Date,
      @Checksum,
      @TrafficType,
      @CampaignId,
      @ItemId,
      @KeywordsId,
      @ReferringSiteId,
      @SiteNameId,
      @DeviceNameId,
      @LanguageId,
      @FirstVisit,
      @Visits,
      @Value
    );
  END

END;

CREATE PROCEDURE [dbo].[Add_Traffic]
  @Date SMALLDATETIME,
  @Checksum INTEGER,
  @TrafficType INTEGER,
  @CampaignId UNIQUEIDENTIFIER,
  @ItemId UNIQUEIDENTIFIER,
  @KeywordsId UNIQUEIDENTIFIER,
  @ReferringSiteId UNIQUEIDENTIFIER,
  @SiteNameId INTEGER,
  @DeviceNameId INTEGER,
  @LanguageId INTEGER,
  @FirstVisit BIT,
  @Visits INTEGER,
  @Value INTEGER
WITH EXECUTE AS OWNER
AS

BEGIN

  SET NOCOUNT ON;

  DECLARE scan_table CURSOR FOR 
  SELECT 
    [Date], [Checksum], [TrafficType], 
    [CampaignId], [ItemId], [KeywordsId], [ReferringSiteId],
    [SiteNameId], [DeviceNameId], [LanguageId], [FirstVisit],
    [Visits], [Value]
  FROM @table;

  DECLARE
    @Date SMALLDATETIME,
    @Checksum INT,
    @TrafficType INT,
    @CampaignId UNIQUEIDENTIFIER,
    @ItemId UNIQUEIDENTIFIER,
    @KeywordsId UNIQUEIDENTIFIER,
    @ReferringSiteId UNIQUEIDENTIFIER,
    @SiteNameId INT,
    @DeviceNameId INT,
    @LanguageId INT,
    @FirstVisit BIT,
    @Visits BIGINT,
    @Value BIGINT;


  OPEN scan_table;

  FETCH NEXT FROM scan_table
  INTO 
    @Date, @Checksum, @TrafficType,
    @CampaignId, @ItemId, @KeywordsId, @ReferringSiteId,
    @SiteNameId, @DeviceNameId, @LanguageId, @FirstVisit,
    @Visits, @Value;

  WHILE @@FETCH_STATUS = 0
  BEGIN
    EXEC Add_Traffic
      @Date=@Date, @Checksum=@Checksum, @TrafficType=@TrafficType,
      @CampaignId=@CampaignId, @ItemId=@ItemId, @KeywordsId=@KeywordsId, @ReferringSiteId=@ReferringSiteId,
      @SiteNameId=@SiteNameId, @DeviceNameId=@DeviceNameId, @LanguageId=@LanguageId, @FirstVisit=@FirstVisit,
      @Visits=@Visits, @Value=@Value

    FETCH NEXT FROM scan_table
    INTO 
      @Date, @Checksum, @TrafficType,
      @CampaignId, @ItemId, @KeywordsId, @ReferringSiteId,
      @SiteNameId, @DeviceNameId, @LanguageId, @FirstVisit,
      @Visits, @Value;
  END

  CLOSE scan_table;

  DEALLOCATE scan_table;
END;

BEGIN
SET NOCOUNT ON;
BEGIN TRY
MERGE [Fact_ValueBySource] AS [target] USING ( VALUES ( @Date, @TrafficType, @SiteNameId, @DeviceNameId, @LanguageId, @FirstVisitValue, @Contacts, @Visits, @Value ) ) AS [source] ( [Date], [TrafficType], [SiteNameId], [DeviceNameId], [LanguageId], [FirstVisitValue], [Contacts], [Visits], [Value] ) ON ( ([target].[Date] = [source].[Date]) AND ([target].[TrafficType] = [source].[TrafficType]) AND ([target].[SiteNameId] = [source].[SiteNameId]) AND ([target].[DeviceNameId] = [source].[DeviceNameId]) AND ([target].[LanguageId] = [source].[LanguageId]) )
WHEN MATCHED THEN UPDATE SET [target].[FirstVisitValue] = ([target].[FirstVisitValue] + [source].[FirstVisitValue]), [target].[Contacts] = ([target].[Contacts] + [source].[Contacts]), [target].[Visits] = ([target].[Visits] + [source].[Visits]), [target].[Value] = ([target].[Value] + [source].[Value])
WHEN NOT MATCHED THEN INSERT ( [Date], [TrafficType], [SiteNameId], [DeviceNameId], [LanguageId], [FirstVisitValue], [Contacts], [Visits], [Value] ) VALUES ( [source].[Date], [source].[TrafficType], [source].[SiteNameId], [source].[DeviceNameId], [source].[LanguageId], [source].[FirstVisitValue], [source].[Contacts], [source].[Visits], [source].[Value] );
END TRY BEGIN CATCH
DECLARE @error_number INTEGER = ERROR_NUMBER(); DECLARE @error_severity INTEGER = ERROR_SEVERITY(); DECLARE @error_state INTEGER = ERROR_STATE(); DECLARE @error_message NVARCHAR(4000) = ERROR_MESSAGE(); DECLARE @error_procedure SYSNAME = ERROR_PROCEDURE(); DECLARE @error_line INTEGER = ERROR_LINE();
IF( @error_number = 2627 ) BEGIN
UPDATE [dbo].[Fact_ValueBySource] SET [FirstVisitValue] = ([FirstVisitValue] + @FirstVisitValue), [Contacts] = ([Contacts] + @Contacts), [Visits] = ([Visits] + @Visits), [Value] = ([Value] + @Value) WHERE ([Date] = @Date) AND ([TrafficType] = @TrafficType) AND ([SiteNameId] = @SiteNameId) AND ([DeviceNameId] = @DeviceNameId) AND ([LanguageId] = @LanguageId);
IF( @@ROWCOUNT != 1 ) BEGIN RAISERROR( 'Failed to insert or update rows in the [Fact_ValueBySource] table.', 18, 1 ) WITH NOWAIT; END
END ELSE BEGIN
RAISERROR( N'T-SQL ERROR %d, SEVERITY %d, STATE %d, PROCEDURE %s, LINE %d, MESSAGE: %s', @error_severity, 1, @error_number, @error_severity, @error_state, @error_procedure, @error_line, @error_message ) WITH NOWAIT;
END;
END CATCH;
END;

