  @Latitude FLOAT,
  @Longitude FLOAT,
  @Visits BIGINT,
  @Value BIGINT
WITH EXECUTE AS OWNER
AS

BEGIN
SET NOCOUNT ON;
BEGIN TRY
MERGE [Fact_VisitsByBusinessContactLocation] AS [target] USING @table AS [source] ON ( ([target].[AccountId] = [source].[AccountId]) AND ([target].[BusinessUnitId] = [source].[BusinessUnitId]) AND ([target].[ContactId] = [source].[ContactId]) AND ([target].[Date] = [source].[Date]) AND ([target].[DeviceNameId] = [source].[DeviceNameId]) AND ([target].[LanguageId] = [source].[LanguageId]) AND ([target].[Latitude] = [source].[Latitude]) AND ([target].[Longitude] = [source].[Longitude]) AND ([target].[SiteNameId] = [source].[SiteNameId]) AND ([target].[TrafficType] = [source].[TrafficType]) )
WHEN MATCHED THEN UPDATE SET [target].[Visits] = ([target].[Visits] + [source].[Visits]), [target].[Value] = ([target].[Value] + [source].[Value])
WHEN NOT MATCHED THEN INSERT ( [AccountId], [BusinessUnitId], [Date], [TrafficType], [SiteNameId], [DeviceNameId], [ContactId], [LanguageId], [Latitude], [Longitude], [Visits], [Value] ) VALUES ( [source].[AccountId], [source].[BusinessUnitId], [source].[Date], [source].[TrafficType], [source].[SiteNameId], [source].[DeviceNameId], [source].[ContactId], [source].[LanguageId], [source].[Latitude], [source].[Longitude], [source].[Visits], [source].[Value] );
END TRY BEGIN CATCH
DECLARE @error_number INTEGER = ERROR_NUMBER(); DECLARE @error_severity INTEGER = ERROR_SEVERITY(); DECLARE @error_state INTEGER = ERROR_STATE(); DECLARE @error_message NVARCHAR(4000) = ERROR_MESSAGE(); DECLARE @error_procedure SYSNAME = ERROR_PROCEDURE(); DECLARE @error_line INTEGER = ERROR_LINE();
RAISERROR( N'T-SQL ERROR %d, SEVERITY %d, STATE %d, PROCEDURE %s, LINE %d, MESSAGE: %s', @error_severity, 1, @error_number, @error_severity, @error_state, @error_procedure, @error_line, @error_message ) WITH NOWAIT;
END CATCH;
END;

