CREATE PROCEDURE [Ensure_SiteName]
  @SiteNameId INTEGER,
  @SiteName NVARCHAR(450)
WITH EXECUTE AS OWNER
AS

BEGIN

  SET NOCOUNT ON;

  MERGE
    [SiteNames] AS [target]
  USING
    @table AS [source]
  ON
    ([target].[SiteNameId] = [source].[SiteNameId])

  WHEN NOT MATCHED THEN
    INSERT
    (
      [SiteNameId],
      [SiteName]
    )
    VALUES
    (
      [source].[SiteNameId],
      [source].[SiteName]
    );

END;

BEGIN
	SET NOCOUNT ON;

	BEGIN TRY

    SELECT			t.Id,
					t.ParentId,
					t.TaxonomyId,
					t.Uri,
					t.Type,
					[dbo].[GetTaxonEntityChildIds](t.Id) AS ChildIds,
					t.IsDeleted
	FROM			[Taxonomy_TaxonEntity] t
	WHERE			t.Uri LIKE '/{' + CONVERT(nvarchar(50), @TaxonomyId) + '}%'

	SELECT			v.TaxonId AS TaxonId,
					d.Id AS FieldId,
					d.Name AS FieldName,
					d.IsLanguageInvariant AS LanguageInvariant,
					v.LanguageCode,
					v.FieldValue
	FROM			[Taxonomy_TaxonEntityFieldDefinition] d
	LEFT OUTER JOIN	[Taxonomy_TaxonEntityFieldValue] v
	ON				d.Id = v.FieldId
	WHERE			v.TaxonId IN (SELECT Id FROM [Taxonomy_TaxonEntity] WHERE Uri LIKE '/{' + CONVERT(NVARCHAR(50), @TaxonomyId) + '}%');

	END TRY
	BEGIN CATCH

		DECLARE @error_number INTEGER = ERROR_NUMBER();
		DECLARE @error_severity INTEGER = ERROR_SEVERITY();
		DECLARE @error_state INTEGER = ERROR_STATE();
		DECLARE @error_message NVARCHAR(4000) = ERROR_MESSAGE();
		DECLARE @error_procedure SYSNAME = ERROR_PROCEDURE();
		DECLARE @error_line INTEGER = ERROR_LINE();

		RAISERROR( N'T-SQL ERROR %d, SEVERITY %d, STATE %d, PROCEDURE %s, LINE %d, MESSAGE: %s', @error_severity, 1, @error_number, @error_severity, @error_state, @error_procedure, @error_line, @error_message ) WITH NOWAIT;

	END CATCH;
END

CREATE PROCEDURE [dbo].[Get_MissingDailyTrees]
     @StartDate Date,
     @EndDate Date
WITH EXECUTE AS OWNER
AS

BEGIN
	SET NOCOUNT ON;

	BEGIN TRY

	SELECT			t.Id,
					t.ParentId,
					t.TaxonomyId,
					t.Type,
					t.Uri,
					[dbo].[GetTaxonEntityChildIds](t.Id) AS ChildIds,
					t.IsDeleted
	FROM			[Taxonomy_TaxonEntity] t
	WHERE			t.Id = @Id;

	SELECT			v.TaxonId AS Id,
					d.Id AS FieldId,
					d.Name AS FieldName,
					d.IsLanguageInvariant AS LanguageInvariant,
					v.LanguageCode,
					v.FieldValue
	FROM			[Taxonomy_TaxonEntityFieldDefinition] d
	LEFT OUTER JOIN	[Taxonomy_TaxonEntityFieldValue] v
	ON				d.Id = v.FieldId
	WHERE			v.TaxonId = @Id;

	END TRY
	BEGIN CATCH

		DECLARE @error_number INTEGER = ERROR_NUMBER();
		DECLARE @error_severity INTEGER = ERROR_SEVERITY();
		DECLARE @error_state INTEGER = ERROR_STATE();
		DECLARE @error_message NVARCHAR(4000) = ERROR_MESSAGE();
		DECLARE @error_procedure SYSNAME = ERROR_PROCEDURE();
		DECLARE @error_line INTEGER = ERROR_LINE();

		RAISERROR( N'T-SQL ERROR %d, SEVERITY %d, STATE %d, PROCEDURE %s, LINE %d, MESSAGE: %s', @error_severity, 1, @error_number, @error_severity, @error_state, @error_procedure, @error_line, @error_message ) WITH NOWAIT;

	END CATCH;
END

BEGIN
	SET NOCOUNT ON;

	BEGIN TRY

    SELECT			t.Id,
					t.ParentId,
					t.Uri,
					[dbo].[GetTaxonEntityChildIds](t.Id) AS ChildIds,
					t.IsDeleted
	FROM			[Taxonomy_TaxonEntity] t
	WHERE			t.ParentId = @Id
	AND				t.TaxonomyId = @TaxonomyId;

	SELECT			v.TaxonId AS TaxonId,
					d.Id AS FieldId,
					d.Name AS FieldName,
					d.IsLanguageInvariant AS LanguageInvariant,
					v.LanguageCode,
					v.FieldValue
	FROM			[Taxonomy_TaxonEntityFieldDefinition] d
	LEFT OUTER JOIN	[Taxonomy_TaxonEntityFieldValue] v
	ON				d.Id = v.FieldId
	WHERE			v.TaxonId IN (SELECT Id FROM [dbo].[Taxonomy_TaxonEntity] WHERE ParentId = @Id);

	END TRY
	BEGIN CATCH

		DECLARE @error_number INTEGER = ERROR_NUMBER();
		DECLARE @error_severity INTEGER = ERROR_SEVERITY();
		DECLARE @error_state INTEGER = ERROR_STATE();
		DECLARE @error_message NVARCHAR(4000) = ERROR_MESSAGE();
		DECLARE @error_procedure SYSNAME = ERROR_PROCEDURE();
		DECLARE @error_line INTEGER = ERROR_LINE();

		RAISERROR( N'T-SQL ERROR %d, SEVERITY %d, STATE %d, PROCEDURE %s, LINE %d, MESSAGE: %s', @error_severity, 1, @error_number, @error_severity, @error_state, @error_procedure, @error_line, @error_message ) WITH NOWAIT;

	END CATCH;
END

CREATE PROCEDURE [Get_TaxonEntityChildren] 
	@Id UNIQUEIDENTIFIER,
	@TaxonomyId UNIQUEIDENTIFIER
WITH EXECUTE AS OWNER
AS

BEGIN
SET NOCOUNT ON;
BEGIN TRY
DECLARE @position INT, @nextPosition INT, @valuelength INT
DECLARE @IdTable TABLE ( Id UNIQUEIDENTIFIER )
SELECT @position = 0, @nextPosition = 1
WHILE @nextPosition > 0
BEGIN SELECT @nextPosition = CHARINDEX(',', @IdList, @position + 1) SELECT @valuelength = CASE WHEN @nextPosition > 0 THEN @nextPosition ELSE LEN(@IdList) + 1 END - @position - 1
INSERT @IdTable (Id) VALUES (CONVERT(UNIQUEIDENTIFIER, SUBSTRING(@IdList, @position + 1, @valuelength))) SELECT @position = @nextPosition END
SELECT t.Id, t.ParentId, t.TaxonomyId, t.Type, t.Uri, [dbo].[GetTaxonEntityChildIds](t.Id) AS ChildIds, t.IsDeleted FROM [Taxonomy_TaxonEntity] t INNER JOIN @IdTable i ON t.Id = i.Id;
SELECT v.TaxonId AS Id, d.Id AS FieldId, d.Name AS FieldName, d.IsLanguageInvariant AS LanguageInvariant, v.LanguageCode, v.FieldValue FROM [Taxonomy_TaxonEntityFieldDefinition] d LEFT OUTER JOIN [Taxonomy_TaxonEntityFieldValue] v ON d.Id = v.FieldId AND (v.LanguageCode = '' OR v.LanguageCode = @LanguageCode) INNER JOIN @IdTable i ON v.TaxonId = i.Id;
END TRY BEGIN CATCH
DECLARE @error_number INTEGER = ERROR_NUMBER(); DECLARE @error_severity INTEGER = ERROR_SEVERITY(); DECLARE @error_state INTEGER = ERROR_STATE(); DECLARE @error_message NVARCHAR(4000) = ERROR_MESSAGE(); DECLARE @error_procedure SYSNAME = ERROR_PROCEDURE(); DECLARE @error_line INTEGER = ERROR_LINE();
RAISERROR( N'T-SQL ERROR %d, SEVERITY %d, STATE %d, PROCEDURE %s, LINE %d, MESSAGE: %s', @error_severity, 1, @error_number, @error_severity, @error_state, @error_procedure, @error_line, @error_message ) WITH NOWAIT;
END CATCH; END

