CREATE FUNCTION [dbo].[GetTagValue]
(
  @data XML,
  @tagName NVARCHAR(100)
)
RETURNS NVARCHAR(1000)
WITH EXECUTE AS OWNER
AS

BEGIN
    SET NOCOUNT ON;

    IF NOT EXISTS
    (
        SELECT TABLE_NAME
        FROM INFORMATION_SCHEMA.TABLES
        WHERE TABLE_NAME = @TableName
    )
        BEGIN
            DECLARE @errorMsg VARCHAR(MAX);
            SET @errorMsg = 'Invalid table name '''+@TableName + '''';
            RAISERROR(@errorMsg, 16, 1);
            RETURN;
        END;

    DECLARE @EndDate SMALLDATETIME;
    DECLARE @sql NVARCHAR(MAX);
    SET @EndDate = DATEADD(day, 1, @Date);

    -- Populate DimensionKeys with record for "other"
    IF NOT EXISTS
    (
        SELECT DimensionKeyId
        FROM DimensionKeys
        WHERE DimensionKey = @RolledUpKey
    )
        BEGIN
            INSERT INTO DimensionKeys
            VALUES
            (@RolledUpKeyId,
             @RolledUpKey
            );
        END;
    CREATE TABLE #segmentIdsTable
    (RowId     INT IDENTITY,
     SegmentId UNIQUEIDENTIFIER
    );
    SET @sql = 'Insert into #segmentIdsTable Select distinct SegmentId from '+QUOTENAME(@TableName);
    IF @debug = 1
        PRINT @sql;
    EXEC (@sql);
    DECLARE @tempTblCount INT=
    (
        SELECT COUNT(*)
        FROM #segmentIdsTable
    );
    DECLARE @index INT= 1;
    DECLARE @SegmentId UNIQUEIDENTIFIER;
    DECLARE @RolledUpRecordId BIGINT;

     -- Prepare columns lists which will be used later in dynamic queries
            DECLARE @ColumnList AS VARCHAR(MAX);
            DECLARE @SumColumnList AS VARCHAR(MAX);
            DECLARE @mergeUpdateColumnList AS VARCHAR(MAX);
            DECLARE @sourceColumnList AS VARCHAR(MAX);
            SET @sql = 'SELECT @ColumnList = COALESCE(@ColumnList+'','' ,'''') + COLUMN_NAME,
		  @SumColumnList = COALESCE(@SumColumnList+'','' ,'''') + ''SUM(''+COLUMN_NAME+'') AS ''+COLUMN_NAME,
		  @mergeUpdateColumnList = COALESCE(@mergeUpdateColumnList+'','' ,'''') + ''[target].''+COLUMN_NAME+'' = [source].''+COLUMN_NAME+'' + [target].''+COLUMN_NAME,
		  @sourceColumnList = COALESCE(@sourceColumnList+'','' ,'''') + ''[source].''+COLUMN_NAME
		  FROM INFORMATION_SCHEMA.COLUMNS
		  where TABLE_NAME = '''+@TableName+''' 
		  and COLUMN_NAME not in (''SegmentRecordId'', ''SegmentId'', ''Date'', ''SiteNameId'', ''DimensionKeyId'');';
            IF @debug = 1
                PRINT @sql;
            EXECUTE sp_executesql
                    @sql,
                    N'@ColumnList AS Varchar(MAX) OUT,@SumColumnList AS Varchar(MAX) OUT,@mergeUpdateColumnList AS Varchar(MAX) OUT,@sourceColumnList AS Varchar(MAX) OUT',
                    @ColumnList = @ColumnList OUTPUT,
                    @SumColumnList = @SumColumnList OUTPUT,
                    @mergeUpdateColumnList = @mergeUpdateColumnList OUTPUT,
                    @sourceColumnList = @sourceColumnList OUTPUT; 


    -- while loop for each distinct segment id in table
    WHILE(@tempTblCount >= @index)
        BEGIN
            SET @SegmentId =
            (
                SELECT SegmentId
                FROM #segmentIdsTable
                WHERE RowId = @index
            );
            SELECT @RolledUpRecordId = CHECKSUM(@SegmentId, @Date, @SiteNameId);

            -- Get the 'count' of records for specified segment, site and date         
            DECLARE @count INT;
            SET @sql = 'SELECT @count = COUNT(*)
		  FROM '+QUOTENAME(@TableName)+' WHERE SegmentId = @SegmentId
		  AND [Date] >= @Date
		  AND [Date] < @EndDate
		  AND [SiteNameId] = @SiteNameId
		  AND [SegmentRecordId] <> @RolledUpRecordId
		  AND DimensionKeyId NOT IN
		  (
			 SELECT DimensionKeyId
			 FROM DimensionKeys
			 WHERE DimensionKey LIKE @ExceptDimensionKey+''%''
		  );';
            IF @debug = 1
                PRINT @sql;
            EXECUTE sp_executesql
                    @sql,
                    N'@SegmentId UNIQUEIDENTIFIER,@Date SMALLDATETIME,@SiteNameId INT,@ExceptDimensionKey NVARCHAR(MAX),@EndDate SMALLDATETIME,@RolledUpRecordId BIGINT,@count INT OUT',
                    @SegmentId = @SegmentId,
                    @Date = @Date,
                    @EndDate = @EndDate,
                    @SiteNameId = @SiteNameId,
                    @ExceptDimensionKey = @ExceptDimensionKey,
                    @RolledUpRecordId = @RolledUpRecordId,
                    @count = @count OUTPUT;

            -- if no records to process, exit	  	   
            IF @count <= @RowsToKeep
            BEGIN
			         SET @index = @index + 1;
               CONTINUE;
            END;


            -- collect the rows eligible to reduce into #EligibleToReduce
            SET @sql = 'SELECT TOP (@count - @RowsToKeep) *
		  INTO #EligibleToReduce
		  FROM '+QUOTENAME(@TableName)+' WHERE SegmentId = @SegmentId
			   AND [Date] >= @Date
			   AND [Date] < @EndDate
			   AND [SiteNameId] = @SiteNameId
			   AND [SegmentRecordId] <> @RolledUpRecordId
			   AND DimensionKeyId NOT IN
				    (
					   SELECT DimensionKeyId
					   FROM DimensionKeys
					   WHERE DimensionKey LIKE @ExceptDimensionKey+''%''
				    )
		  ORDER BY '+@OrderBy+ 

            -- reduce into #Reduced
            ' SELECT @RolledUpRecordId AS SegmentRecordId,
			SegmentId,
			Date,
			SiteNameId,
			@RolledUpKeyId AS DimensionKeyId,'+@SumColumnList+' INTO #Reduced
		  FROM #EligibleToReduce
		  GROUP BY SegmentId, Date, SiteNameId;'+


            -- merge thre reduced rows from #Reduced to the original table 
            'MERGE '+QUOTENAME(@TableName)+' AS [target]
		  USING #Reduced AS [source]
		  ON([target].[SegmentRecordId] = [source].[SegmentRecordId] -- Assumpution: @RolledUpRecordId is a hash of (SegmentId, date, siteName)
		  )
			 WHEN MATCHED
			 THEN UPDATE SET '+@mergeUpdateColumnList+' WHEN NOT MATCHED
			 THEN INSERT([SegmentRecordId],
					   [SegmentId],
					   [Date],
					   [SiteNameId],
					   [DimensionKeyId],'+@ColumnList+') VALUES
		  ([source].[SegmentRecordId],
		   [source].[SegmentId],
		   [source].[Date],
		   [source].[SiteNameId],
		   [source].[DimensionKeyId],'+@sourceColumnList+');'+

            -- delete the original rows which have already been reduced 
            'DELETE '+QUOTENAME(@TableName)+' WHERE SegmentRecordId IN
		  (
			 SELECT SegmentRecordId
			 FROM #EligibleToReduce
		  );

		  DROP TABLE #Reduced;
		  DROP TABLE #EligibleToReduce;';
            IF @debug = 1
                PRINT @sql;
            EXECUTE sp_executesql
                    @sql,
                    N'@SegmentId UNIQUEIDENTIFIER,@Date SMALLDATETIME,@SiteNameId INT,@RolledUpRecordId BIGINT,@RolledUpKeyId BIGINT,@RowsToKeep INT,@ExceptDimensionKey NVARCHAR(MAX),@EndDate SMALLDATETIME,@count INT,@ColumnList AS VARCHAR(MAX),@SumColumnList AS VARCHAR(MAX),@mergeUpdateColumnList AS VARCHAR(MAX),@sourceColumnList AS VARCHAR(MAX)',
                    @SegmentId = @SegmentId,
                    @Date = @Date,
                    @EndDate = @EndDate,
                    @SiteNameId = @SiteNameId,
                    @ExceptDimensionKey = @ExceptDimensionKey,
                    @count = @count,
                    @RolledUpRecordId = @RolledUpRecordId,
                    @RolledUpKeyId = @RolledUpKeyId,
                    @RowsToKeep = @RowsToKeep,
                    @ColumnList = @ColumnList,
                    @SumColumnList = @SumColumnList,
                    @mergeUpdateColumnList = @mergeUpdateColumnList,
                    @sourceColumnList = @sourceColumnList;
            SET @index = @index + 1;
        END;
    DROP TABLE #segmentIdsTable;
END;

CREATE PROCEDURE [dbo].[ReduceMetricsTable] 
@SiteNameId         INT,
@Date               SMALLDATETIME,
@RolledUpKeyId      BIGINT,
@RolledUpKey        NVARCHAR(MAX),
@RowsToKeep         INT,
@ExceptDimensionKey NVARCHAR(MAX),
@TableName          SYSNAME,
@OrderBy            NVARCHAR(MAX),
@debug              BIT           = 0
WITH EXECUTE AS OWNER
AS

BEGIN SET NOCOUNT ON;
DECLARE @EndDate smalldatetime SET @EndDate = DATEADD(day, 1, @StartDate)
-- Copy segment data for given date range -- Compute order value CREATE TABLE [dbo].[#tmp]( [PredicateOrder] [bigint] NULL, [SegmentId] [uniqueidentifier] NOT NULL, [Date] [smalldatetime] NOT NULL, [SiteNameId] [int] NOT NULL, [DimensionKeyId] [bigint] NOT NULL, [SegmentRecordId] [bigint] NOT NULL, [ContactTransitionType] [tinyint] NOT NULL, [Visits] [int] NOT NULL, [Value] [int] NOT NULL, [Bounces] [int] NOT NULL, [Conversions] [int] NOT NULL, [TimeOnSite] [int] NOT NULL, [Pageviews] [int] NOT NULL, [Count] [int] NOT NULL ) ON [PRIMARY]
INSERT #tmp SELECT ROW_NUMBER() OVER(ORDER BY sm.Visits DESC, ABS(sm.Value) DESC) AS 'PredicateOrder', sr.[SegmentId], sr.[Date], sr.[SiteNameId], sr.[DimensionKeyId], sm.[SegmentRecordId], sm.[ContactTransitionType], sm.[Visits], sm.[Value], sm.[Bounces], sm.[Conversions], sm.[TimeOnSite], sm.[Pageviews], sm.[Count] FROM SegmentRecords sr INNER JOIN Fact_SegmentMetrics sm ON sr.SegmentRecordId = sm.SegmentRecordId INNER JOIN DimensionKeys dk ON dk.DimensionKeyId = sr.DimensionKeyId WHERE sr.SegmentId = @SegmentId AND sr.[Date] >= @StartDate AND sr.[Date] < @EndDate AND sr.[SiteNameId] = @SiteNameId AND dk.DimensionKey Not Like @UnclassifiedDeviceKey + '%'
-- Compute how many records to keep DECLARE @KeepCount int SELECT @KeepCount = MAX(PredicateOrder) FROM #tmp
IF(@KeepCount > @KeepCountThreshold) SET @KeepCount = @KeepCountThreshold
ELSE BEGIN SELECT @KeepCount = MAX(PredicateOrder) FROM #tmp WHERE Visits > @VisitThreshold AND ABS(Value) > @ValueThreshold
IF(@KeepCount IS NULL) SET @KeepCount = 0 END
-- Populate SegmentRecordsReduced from temp table -- Use top KeepCount records (highest predicate value) MERGE [SegmentRecordsReduced] AS [target] USING ( SELECT DISTINCT [SegmentRecordId], [SegmentId], [Date], [SiteNameId], [DimensionKeyId] FROM #tmp WHERE PredicateOrder <= @KeepCount ) AS [source] ([SegmentRecordId], [SegmentId], [Date], [SiteNameId], [DimensionKeyId]) ON ( [target].[SegmentRecordId] = [source].[SegmentRecordId] ) WHEN MATCHED THEN UPDATE SET [target].[SegmentId] = [source].[SegmentId], [target].[Date] = [source].[Date], [target].[SiteNameId] = [source].[SiteNameId], [target].[DimensionKeyId] = [source].[DimensionKeyId] WHEN NOT MATCHED THEN INSERT ([SegmentRecordId], [SegmentId], [Date], [SiteNameId], [DimensionKeyId]) VALUES ( [source].[SegmentRecordId], [source].[SegmentId], [source].[Date], [source].[SiteNameId], [source].[DimensionKeyId] );
-- Populate Fact_SegmentMetricsReduced from temp table -- Use top KeepCount records (highest predicate value) MERGE [Fact_SegmentMetricsReduced] AS [target] USING ( SELECT [SegmentRecordId], [ContactTransitionType], [Visits], [Value], [Bounces], [Conversions], [TimeOnSite], [Pageviews], [Count] FROM #tmp WHERE PredicateOrder <= @KeepCount ) AS [source] ([SegmentRecordId], [ContactTransitionType], [Visits], [Value], [Bounces], [Conversions], [TimeOnSite], [Pageviews], [Count]) ON ( [target].[SegmentRecordId] = [source].[SegmentRecordId] AND [target].[ContactTransitionType] = [source].[ContactTransitionType] ) WHEN MATCHED THEN UPDATE SET [target].[Visits] = [source].[Visits] + [target].[Visits], [target].[Value] = [source].[Value] + [target].[Value], [target].[Bounces] = [source].[Bounces] + [target].[Bounces], [target].[Conversions] = [source].[Conversions] + [target].[Conversions], [target].[TimeOnSite] = [source].[TimeOnSite] + [target].[TimeOnSite], [target].[Pageviews] = [source].[Pageviews] + [target].[Pageviews], [target].[Count] = [source].[Count] + [target].[Count] WHEN NOT MATCHED THEN INSERT ([SegmentRecordId], [ContactTransitionType], [Visits], [Value], [Bounces], [Conversions], [TimeOnSite], [Pageviews], [Count]) VALUES ( [source].[SegmentRecordId], [source].[ContactTransitionType], [source].[Visits], [source].[Value], [source].[Bounces], [source].[Conversions], [source].[TimeOnSite], [source].[Pageviews], [source].[Count] );
-- Populate DimensionKeys with record for "other" MERGE [DimensionKeys] AS [target] USING ( VALUES (@OtherDimensionKeyId, @OtherDimensionKey) ) AS [source] ([DimensionKeyId], [DimensionKey]) ON ( [target].[DimensionKeyId] = [source].[DimensionKeyId] ) WHEN NOT MATCHED THEN INSERT ([DimensionKeyId], [DimensionKey]) VALUES ( [source].[DimensionKeyId], [source].[DimensionKey] );
-- Populate SegmentRecordsReduced with one record for "other" if some records were reduced IF (EXISTS (SELECT * FROM #tmp WHERE PredicateOrder > @KeepCount)) MERGE [SegmentRecordsReduced] AS [target] USING ( VALUES (@OtherSegmentRecordId, @SegmentId, @StartDate, @SiteNameId, @OtherDimensionKeyId) ) AS [source] ([SegmentRecordId], [SegmentId], [Date], [SiteNameId], [DimensionKeyId]) ON ( [target].[SegmentRecordId] = [source].[SegmentRecordId] ) WHEN MATCHED THEN UPDATE SET [target].[SegmentId] = [source].[SegmentId], [target].[Date] = [source].[Date], [target].[SiteNameId] = [source].[SiteNameId], [target].[DimensionKeyId] = [source].[DimensionKeyId] WHEN NOT MATCHED THEN INSERT ([SegmentRecordId], [SegmentId], [Date], [SiteNameId], [DimensionKeyId]) VALUES ( [source].[SegmentRecordId], [source].[SegmentId], [source].[Date], [source].[SiteNameId], [source].[DimensionKeyId] );
-- Populate Fact_SegmentMetricsReduced from temp table with "other" records. -- Other is a summary of bottom records (lowest predicate value; above KeepCount) MERGE [Fact_SegmentMetricsReduced] AS [target] USING ( SELECT @OtherSegmentRecordId AS [SegmentRecordId], [ContactTransitionType], SUM([Visits]) AS [Visits], SUM([Value]) AS [Value], SUM([Bounces]) AS [Bounces], SUM([Conversions]) AS [Conversions], SUM([TimeOnSite]) AS [TimeOnSite], SUM([Pageviews]) AS [Pageviews], SUM([Count]) AS [Count] FROM #tmp WHERE PredicateOrder > @KeepCount GROUP BY ContactTransitionType ) AS [source] ([SegmentRecordId], [ContactTransitionType], [Visits], [Value], [Bounces], [Conversions], [TimeOnSite], [Pageviews], [Count]) ON ( [target].[SegmentRecordId] = [source].[SegmentRecordId] AND [target].[ContactTransitionType] = [source].[ContactTransitionType] ) WHEN MATCHED THEN UPDATE SET [target].[Visits] = [source].[Visits] + [target].[Visits], [target].[Value] = [source].[Value] + [target].[Value], [target].[Bounces] = [source].[Bounces] + [target].[Bounces], [target].[Conversions] = [source].[Conversions] + [target].[Conversions], [target].[TimeOnSite] = [source].[TimeOnSite] + [target].[TimeOnSite], [target].[Pageviews] = [source].[Pageviews] + [target].[Pageviews], [target].[Count] = [source].[Count] + [target].[Count] WHEN NOT MATCHED THEN INSERT ([SegmentRecordId], [ContactTransitionType], [Visits], [Value], [Bounces], [Conversions], [TimeOnSite], [Pageviews], [Count]) VALUES ( [source].[SegmentRecordId], [source].[ContactTransitionType], [source].[Visits], [source].[Value], [source].[Bounces], [source].[Conversions], [source].[TimeOnSite], [source].[Pageviews], [source].[Count] );
--pruning trace IF @Debug = 1 BEGIN SELECT * FROM Fact_SegmentMetrics INNER JOIN SegmentRecords ON Fact_SegmentMetrics.SegmentRecordId=SegmentRecords.SegmentRecordId WHERE Fact_SegmentMetrics.SegmentRecordId IN (SELECT SegmentRecordId FROM #tmp) END
-- Delete processed data from Fact_SegmentMetrics and SegmentRecords
IF @DryRun = 0 BEGIN PRINT N'Deleting source records.'; DELETE Fact_SegmentMetrics WHERE SegmentRecordId IN (SELECT SegmentRecordId FROM #tmp) DELETE SegmentRecords WHERE SegmentRecordId IN (SELECT SegmentRecordId FROM #tmp) END ELSE BEGIN PRINT N'Executed in dry run mode.'; END
DROP TABLE #tmp
END

