  BEGIN
    SET @Processed = GETUTCDATE();
  END

  INSERT INTO [Trail_AutomationStates]
  (
    [AutomationStateId],
    [SeqNumber],
    [Processed]
  )
  VALUES
  (
    @AutomationStateId,
    @SeqNumber,
    @Processed
  );

END;

