CREATE PROCEDURE [Upsert_Contact]
  @ContactId UNIQUEIDENTIFIER,
  @AuthenticationLevel INTEGER,
  @Classification INTEGER,
  @ContactTags XML,
  @IntegrationLevel INTEGER,
  @ExternalUser NVARCHAR(100),
  @OverrideClassification INTEGER
WITH EXECUTE AS OWNER
AS

BEGIN SET NOCOUNT ON;
BEGIN TRY
DECLARE @entities TABLE( Id UNIQUEIDENTIFIER NOT NULL, ParentId UNIQUEIDENTIFIER, TaxonomyId UNIQUEIDENTIFIER NOT NULL, [Type] NVARCHAR(255) NOT NULL, Uri NVARCHAR(MAX) NOT NULL PRIMARY KEY (Id));
-- parse out the xml into a table INSERT INTO @entities (Id, ParentId, TaxonomyId, [Type], Uri) SELECT CONVERT(UNIQUEIDENTIFIER, e.value('@id', 'NVARCHAR(50)')), CASE WHEN e.exist('@parentId') = 1 THEN CONVERT(UNIQUEIDENTIFIER, e.value('@parentId', 'NVARCHAR(50)')) ELSE NULL END, CONVERT(UNIQUEIDENTIFIER, e.value('@taxonomyId', 'NVARCHAR(50)')), e.value('@type', 'NVARCHAR(255)'), e.value('@uri', 'NVARCHAR(MAX)') FROM @EntitiesXml.nodes('/entities/entity') AS T(e)
-- add the new taxons INSERT INTO [Taxonomy_TaxonEntity] (Id, ParentId, TaxonomyId, [Type], Uri, IsDeleted) SELECT e.Id, e.ParentId, e.TaxonomyId, e.[Type], e.Uri, 0 FROM @entities e LEFT OUTER JOIN [Taxonomy_TaxonEntity] te ON te.Id = e.Id WHERE te.Id IS NULL
-- update the existing taxons UPDATE [Taxonomy_TaxonEntity] SET ParentId = e.ParentId, TaxonomyId = e.TaxonomyId, [Type] = e.[Type], Uri = e.Uri, IsDeleted = 0 FROM [Taxonomy_TaxonEntity] te INNER JOIN @entities e ON te.Id = e.Id
END TRY BEGIN CATCH
DECLARE @error_number INTEGER = ERROR_NUMBER(); DECLARE @error_severity INTEGER = ERROR_SEVERITY(); DECLARE @error_state INTEGER = ERROR_STATE(); DECLARE @error_message NVARCHAR(4000) = ERROR_MESSAGE(); DECLARE @error_procedure SYSNAME = ERROR_PROCEDURE(); DECLARE @error_line INTEGER = ERROR_LINE();
RAISERROR( N'T-SQL ERROR %d, SEVERITY %d, STATE %d, PROCEDURE %s, LINE %d, MESSAGE: %s', @error_severity, 1, @error_number, @error_severity, @error_state, @error_procedure, @error_line, @error_message ) WITH NOWAIT;
END CATCH; END;

BEGIN
	SET NOCOUNT ON;

	BEGIN TRY

    IF EXISTS
	(
		SELECT	1
		FROM	[Taxonomy_TaxonEntity]
		WHERE	[Id] = @Id
	)
	BEGIN
		UPDATE	[Taxonomy_TaxonEntity]
		SET		[ParentId] = @ParentId,
				[TaxonomyId] = @TaxonomyId,
				[Type] = @Type,
				[Uri] = @Uri,
				[IsDeleted] = @IsDeleted
		WHERE	[Id] = @Id;
	END
	ELSE
	BEGIN
		INSERT INTO	[Taxonomy_TaxonEntity] ([Id], [ParentId], [TaxonomyId], [Type], [Uri], [IsDeleted])
		VALUES		(@Id, @ParentId, @TaxonomyId, @Type, @Uri, @IsDeleted);
	END

	END TRY
	BEGIN CATCH

		DECLARE @error_number INTEGER = ERROR_NUMBER();
		DECLARE @error_severity INTEGER = ERROR_SEVERITY();
		DECLARE @error_state INTEGER = ERROR_STATE();
		DECLARE @error_message NVARCHAR(4000) = ERROR_MESSAGE();
		DECLARE @error_procedure SYSNAME = ERROR_PROCEDURE();
		DECLARE @error_line INTEGER = ERROR_LINE();

		RAISERROR( N'T-SQL ERROR %d, SEVERITY %d, STATE %d, PROCEDURE %s, LINE %d, MESSAGE: %s', @error_severity, 1, @error_number, @error_severity, @error_state, @error_procedure, @error_line, @error_message ) WITH NOWAIT;

	END CATCH;
END

CREATE PROCEDURE [Upsert_TaxonEntity]
	@Id UNIQUEIDENTIFIER,
	@ParentId UNIQUEIDENTIFIER,
	@TaxonomyId UNIQUEIDENTIFIER,
	@Type NVARCHAR(255),
	@Uri NVARCHAR(MAX),
	@IsDeleted BIT
WITH EXECUTE AS OWNER
AS

BEGIN SET NOCOUNT ON;
BEGIN TRY
-- create/update the field definition IF EXISTS ( SELECT 1 FROM [Taxonomy_TaxonEntityFieldDefinition] WHERE Id = @Id ) BEGIN UPDATE [Taxonomy_TaxonEntityFieldDefinition] SET Name = @FieldName, IsLanguageInvariant = @IsLanguageInvariant WHERE Id = @Id END ELSE BEGIN INSERT INTO [Taxonomy_TaxonEntityFieldDefinition] (Id, Name, IsLanguageInvariant) VALUES (@Id, @FieldName, @IsLanguageInvariant); END
-- create/update the field value IF EXISTS ( SELECT 1 FROM [Taxonomy_TaxonEntityFieldValue] WHERE [TaxonId] = @TaxonId AND [FieldId] = @Id AND [LanguageCode] = @LanguageCode ) BEGIN UPDATE [Taxonomy_TaxonEntityFieldValue] SET [FieldValue] = @Value WHERE [TaxonId] = @TaxonId AND [FieldId] = @Id AND [LanguageCode] = @LanguageCode; END ELSE BEGIN INSERT INTO [Taxonomy_TaxonEntityFieldValue] ([TaxonId], [FieldId], [LanguageCode], [FieldValue]) VALUES (@TaxonId, @Id, @LanguageCode, @Value); END
END TRY BEGIN CATCH
DECLARE @error_number INTEGER = ERROR_NUMBER(); DECLARE @error_severity INTEGER = ERROR_SEVERITY(); DECLARE @error_state INTEGER = ERROR_STATE(); DECLARE @error_message NVARCHAR(4000) = ERROR_MESSAGE(); DECLARE @error_procedure SYSNAME = ERROR_PROCEDURE(); DECLARE @error_line INTEGER = ERROR_LINE();
RAISERROR( N'T-SQL ERROR %d, SEVERITY %d, STATE %d, PROCEDURE %s, LINE %d, MESSAGE: %s', @error_severity, 1, @error_number, @error_severity, @error_state, @error_procedure, @error_line, @error_message ) WITH NOWAIT;
END CATCH; END

CREATE PROCEDURE [Upsert_TaxonEntityField]
	@TaxonId UNIQUEIDENTIFIER,
	@Id UNIQUEIDENTIFIER,
	@FieldName NVARCHAR(255),
	@LanguageCode NVARCHAR(10),
	@IsLanguageInvariant BIT,
	@Value NVARCHAR(MAX)
WITH EXECUTE AS OWNER
AS

BEGIN SET NOCOUNT ON;
BEGIN TRY
DECLARE @entityFieldDefs TABLE( Id UNIQUEIDENTIFIER NOT NULL, Name NVARCHAR(255) NOT NULL, IsLanguageInvariant BIT NOT NULL, PRIMARY KEY (Id));
DECLARE @entityFieldValues TABLE( TaxonId UNIQUEIDENTIFIER NOT NULL, FieldId UNIQUEIDENTIFIER, LanguageCode NVARCHAR(10) NOT NULL, FieldValue NVARCHAR(max) NOT NULL, PRIMARY KEY (TaxonId, FieldId, LanguageCode));
-- split the xml out into the two tables INSERT INTO @entityFieldDefs (Id, Name, IsLanguageInvariant) SELECT fieldDefs.Id, fieldDefs.Name, fieldDefs.IsLanguageInvariant FROM ( -- deduplicate the fields to get the unique field defs SELECT allFieldInstances.*, ROW_NUMBER() OVER (PARTITION BY Id ORDER BY Id ASC) AS Position FROM ( -- get all fields from xml, which could have duplicate fields for different languages SELECT CONVERT(UNIQUEIDENTIFIER, f.value('@id', 'NVARCHAR(50)')) AS Id, f.value('@name', 'NVARCHAR(255)') AS Name, f.value('@isLanguageInvariant', 'bit') AS IsLanguageInvariant FROM @EntityFieldsXml.nodes('/entityFields/entityField') AS T(f) ) AS [allFieldInstances] ) [fieldDefs] WHERE Position = 1
INSERT INTO @entityFieldValues (TaxonId, FieldId, LanguageCode, FieldValue) SELECT fieldValues.TaxonId, fieldValues.FieldId, fieldValues.LanguageCode, fieldValues.FieldValue FROM ( -- deduplicate the field values to get rid of any duplicate invariant fields SELECT allFieldValues.*, ROW_NUMBER() OVER (PARTITION BY TaxonId, FieldId, LanguageCode ORDER BY TaxonId) AS Position FROM ( -- get all the fields from the xml, which could have duplicate invariant fields for the same taxon that came from -- different language variants of the same taxon SELECT CONVERT(UNIQUEIDENTIFIER, f.value('@taxonId', 'NVARCHAR(50)')) AS TaxonId, CONVERT(UNIQUEIDENTIFIER, f.value('@id', 'NVARCHAR(50)')) AS FieldId, f.value('@languageCode', 'NVARCHAR(255)') AS LanguageCode, f.value('@value', 'NVARCHAR(255)') AS FieldValue FROM @EntityFieldsXml.nodes('/entityFields/entityField') AS T(f) ) AS [allFieldValues] ) [fieldValues] WHERE Position = 1
-- add the new field defs INSERT INTO [Taxonomy_TaxonEntityFieldDefinition] (Id, Name, IsLanguageInvariant) SELECT efd.Id, efd.Name, efd.IsLanguageInvariant FROM @entityFieldDefs efd LEFT OUTER JOIN [Taxonomy_TaxonEntityFieldDefinition] fd ON fd.Id = efd.Id WHERE fd.Id IS NULL
-- update the existing field defs UPDATE [Taxonomy_TaxonEntityFieldDefinition] SET Id = efd.Id, Name = efd.Name, IsLanguageInvariant = efd.IsLanguageInvariant FROM [Taxonomy_TaxonEntityFieldDefinition] fd INNER JOIN @entityFieldDefs efd ON fd.Id = efd.Id
-- add the new field values INSERT INTO [Taxonomy_TaxonEntityFieldValue] (TaxonId, FieldId, LanguageCode, FieldValue) SELECT efv.TaxonId, efv.FieldId, efv.LanguageCode, efv.FieldValue FROM @entityFieldValues efv LEFT OUTER JOIN [Taxonomy_TaxonEntityFieldValue] fv ON fv.TaxonId = efv.TaxonId AND fv.FieldId = efv.FieldId AND fv.LanguageCode = efv.LanguageCode WHERE fv.TaxonId IS NULL
-- update the existing field values UPDATE [Taxonomy_TaxonEntityFieldValue] SET FieldValue = efv.FieldValue FROM @entityFieldValues efv INNER JOIN [Taxonomy_TaxonEntityFieldValue] fv ON fv.TaxonId = efv.TaxonId AND fv.FieldId = efv.FieldId AND fv.LanguageCode = efv.LanguageCode
END TRY BEGIN CATCH
DECLARE @error_number INTEGER = ERROR_NUMBER(); DECLARE @error_severity INTEGER = ERROR_SEVERITY(); DECLARE @error_state INTEGER = ERROR_STATE(); DECLARE @error_message NVARCHAR(4000) = ERROR_MESSAGE(); DECLARE @error_procedure SYSNAME = ERROR_PROCEDURE(); DECLARE @error_line INTEGER = ERROR_LINE();
RAISERROR( N'T-SQL ERROR %d, SEVERITY %d, STATE %d, PROCEDURE %s, LINE %d, MESSAGE: %s', @error_severity, 1, @error_number, @error_severity, @error_state, @error_procedure, @error_line, @error_message ) WITH NOWAIT;
END CATCH; END;
